import React, { Component } from 'react';
import { render } from 'react-dom';
import Typed from 'react-typed';

export default class Home extends Component {
    render() {
        return (
            <div style={{
                width: '100%',
                height: '400px',
                background: '#00363d',
                marginTop: '70px'

            }}>
                <Typed
                    strings={['Here you can find anything']}
                    typeSpeed={40}
                />
                <br />

                <Typed
                    strings={[
                        'Search for products',
                        'Search for categories',
                        'Search for brands']}
                    typeSpeed={40}
                    backSpeed={50}
                    attr="placeholder"
                    loop >
                    <input type="text" />
                </Typed>
            </div>
        )
    }
}

render(
    <Home />,
    document.getElementById('app'),
);
